import React from 'react';

 const ToolTip = (props) => {
  return (
    <div id="tooltip" class="righton" style="left: 200px; top: 45px;">
        <div class="tooltip-arrow"></div>
        <div class="tooltip-label">ToolTip Component</div>
    </div> 
  );
};

export default Tag;
